import React from "react";
import "./style.css";

function SortButtons(props) {
  return (
      <div>
          <button type="button" className="btn btn-info" onClick={props.sortId}>Managers</button>
          <button type="button" className="btn btn-info" onClick={props.sortName}>Sales</button>
          <button type="button" className="btn btn-success" onClick={props.sortDob}>Accountants</button>
      </div>
  )
}

export default SortButtons;
